import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        This app gets persons
      </header>
      <button onClick={getPersons()}>Click here to get persons</button>
    </div>
  );
}


function getPersons() {
  return fetch("localhost:8080/person").then((response) => response.json())
}
export default App;
